import React from "react";

function DataPassingUsingProps(props) {
  return (
    <div className="grid grid-cols-3">
      <div>
        <img src="https://demos.onepagelove.com/html/stage/images/event-banner.jpg" className="h-full" />
      </div>
      <div className="grid grid-cols-2 col-span-2">
        {props.cardInfo.map((value, index) => {
          return (
            <div className=" flex  justify-between">
              <div>
                <h3>{value.CardName}</h3>
                <h5>{value.ticketInfo}</h5>
              </div>
              <div>
                <h4>{value.Price}</h4>
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
}

export default DataPassingUsingProps;
